import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

const cors = require('cors');

app.use(cors({
  origin: 'http://localhost:3000', // React's port
  credentials: true
}));


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
